  CollectorProfileExtraProperty_44919:
    property_name: ABOUT.COLLECTIONS
    property_value: "it all started from the question... why not? \r\n\r\nso i started  collecting thor figures. not exactly all thor merchandise that's available in the market, only the ones that i really like and the ones that i think, are worth displaying.\r\n\r\ni'm planning to start collecting other marvel statues soon."
